import React, { PureComponent } from 'react';
import {PieChart, Pie, Tooltip} from "recharts";
export const MyPieChart = ({data}) => {
    const innerdata = [
        { name: 'C1', value: 100 },
        { name: 'C2', value: 20 },
        { name: 'C3', value: 300 },
        { name: 'C4', value: 90 },
    ];

    const outerdata = [
        { name: 'P1', value: 10 },
        { name: 'P2', value: 100 },
        { name: 'P3', value: 20 },
        { name: 'P4', value: 30 },
        { name: 'P5', value: 90 }
    ];

    return (
        <div>
            <PieChart width={1000} height={400}>
                <Pie
                    dataKey="value"
                    isAnimationActive={false}
                    data={data}
                    cx={200}
                    cy={200}
                    outerRadius={80}
                    fill="#8884d8"
                    label
                />
                <Tooltip />
            </PieChart>
        </div>
    )
}
